import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './pages/HomePage';
import TimelinePage from './pages/TimelinePage';
import YearEventsPage from './pages/YearEventsPage';
import AgeEventsPage from './pages/AgeEventsPage';
import { timelineData } from './data/timelineData';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/timeline/:id" element={<TimelinePage />} />
        <Route path="/year/:year" element={<YearEventsPage timelineData={timelineData} />} />
        <Route path="/age/:age" element={<AgeEventsPage timelineData={timelineData} />} />
      </Routes>
    </Router>
  );
}

export default App;
